import React from 'react'
import classes from './Messages.module.css'
import {NavLink} from 'react-router-dom'

const DialogItem = () => {
    return (
        <div>
            <NavLink></NavLink>
        </div>
    );
}

const Messages = () => {
    return (
        <div>
            <DialogItem id='1' name='Anton' />
        </div>
    );
}

export default Messages
